import React from "react";
import { NavLink } from "react-router-dom";

import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { ListGroup } from "react-bootstrap";
import Me from "../assets/me.jpeg";
import {
  faLaptopCode,
  faFilePdf,
  faUser,
  faEnvelopeOpenText
} from "@fortawesome/free-solid-svg-icons";

const SideNavigation = () => {
  return (
    <div className="sidebar-fixed position-fixed">
      <a href="#!" className="logo-wrapper waves-effect">
        <img alt="Amirreza Ghanei" className="img-fluid myPic shadow mt-3" src={Me} />
      </a>
      <hr />
      <ListGroup className="list-group-flush">
        <NavLink to="/dashboard/profile" activeClassName="activeClass">
          <ListGroup.Item>
            <FontAwesomeIcon icon={faUser} className="mr-3" />
            About
          </ListGroup.Item>
        </NavLink>
        <NavLink to="/dashboard/tables" activeClassName="activeClass">
          <ListGroup.Item>
            <FontAwesomeIcon icon={faLaptopCode} className="mr-3" />
            Knowledge
          </ListGroup.Item>
        </NavLink>
        <NavLink to="/dashboard/maps" activeClassName="activeClass">
          <ListGroup.Item>
            <FontAwesomeIcon icon={faFilePdf} className="mr-3" />
            Documents
          </ListGroup.Item>
        </NavLink>
        <NavLink to="/dashboard/404" activeClassName="activeClass">
          <ListGroup.Item>
            <FontAwesomeIcon icon={faEnvelopeOpenText} className="mr-3" />
            Contact
          </ListGroup.Item>
        </NavLink>
      </ListGroup>
    </div>
  );
};

export default SideNavigation;
